import Sections from "./sections";

export default function SeasonsFlowers() {
  const items = [
    {
      title: "Tulips",
      href: "/flowers/tulips",
      img: "/tulips.webp",
      imgAlt: "tulips",
    },
    {
      title: "Daffodils",
      href: "/flowers/daffodils",
      img: "/sale.webp",
      imgAlt: "sale",
    },
    {
      title: "Hydrangeas",
      href: "/flowers/hydrangeas",
      img: "/sale.webp",
      imgAlt: "sale",
    },
    {
      title: "Sunflowers",
      href: "/flowers/sunflowers",
      img: "/sale.webp",
      imgAlt: "sale",
    },
    {
      title: "Daisies",
      href: "/flowers/daisies",
      img: "/sale.webp",
      imgAlt: "sale",
    },
    {
      title: "Spring Plants",
      href: "/flowers/springplants",
      img: "/sale.webp",
      imgAlt: "sale",
    },
  ];
  return <Sections title={"Shop All Spring Flowers"} items={items}></Sections>;
}
